  [],\n\t\"revision_timestamp\": \"2016-07-27T22:24:54.801372\",\n\t\"name\": \"wheeler-national-wildlife-refuge-annual-narrative-report-calendar-year-1995\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Wheeler,
  Watercress Darter, Fern Cave, and Blowing Wind Cave (now Sauta Cave) National Wildlife
  Refuges covers refuge activities during the 1995 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the management
  plan, public participation, compliance with environmental and cultural resource
  mandates, and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grazing, haying, fire management, pest control,
  and wilderness areas. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, fisheries resources, scientific collections, animal control,
  marking and banding, and disease control. The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive programs, hunting, fishing,
  trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, communication systems,
  and energy conservation. Cooperative programs and items of interest are provided
  at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
